    false,nt"url": null,nt"notes": "This file contains the date, CUSIP numbers,
    ticker symbols, issuer name, price, and total number of fails-to-deliver (i.e.,
    the balance level outstanding) recorded in the National Securities Clearing Corporation's
    ("NSCC") Continuous Net Settlement (CNS) system aggregated over all NSCC members
    for securities with a balance of total fails-to-deliver of under 10,000 shares between
    September 16, 2008 and June 30, 2009. Prior to January 21, 2010, this data was not
    available. The data include fails-to-deliver in equity securities. The values of
    total fails-to-deliver shares represent the aggregate net balance of shares that
    failed to be delivered as of a particular settlement date. Fails to deliver on a
    given day are a cumulative number of all fails outstanding until that day, plus
    new fails that occur that day, less fails that settle that day. The figure is not
    a daily amount of fails, but a combined figure that includes both new fails on the
    reporting day as well as existing fails. In other words, these numbers reflect aggregate
    fails as of a specific point in time, and may have little or no relationship to
    yesterday's aggregate fails. Thus, it is important to note that the age of fails
    cannot be determined by looking at these numbers. In addition, the underlying source(s)
    of the fails-to-deliver shares is not necessarily the same as the underlying source(s)
    of the fails-to-deliver shares reported the day prior or the day after.",nt"license_title":
